import React from "react";
import { useSelector } from "react-redux";
import { PostsState } from "../../store";

interface Post {
  post: PostsState;
}

const Post: React.FC = () => {
  const post = useSelector((state: Post) => state.post.post);

  return (
    <div>
      <p>Hello</p>
    </div>
  );
};

export default Post;
